import React from "react";
import { Box } from "@mui/material";
import Button from "@mui/material/Button";

export default function ChatData({ chat }) {
  return (
    <Box>
      {chat.map((text) => (
        <>
          <p>{text}</p>
          <p>AI</p>
          <Button variant="contained">Details</Button>
          <hr />
        </>
      ))}
    </Box>
  );
}
